import React, { Component } from 'react';
import Form from '../containers/Form';
import cool_pic from '../assets/image/cool_pic.jpg';
import semen from '../assets/image/semen.jpg';
import land from '../assets/image/land.jpg';
import './Ethiopia.css';


class Ethiopia extends Component {
    state = {
        register: false
    }

    clickHandler = (e) => {
        this.setState({
            register: !this.state.register
        });
    }

    render () {
        if (this.state.register) {
            return (
               <Form />
            );
        }
        return (
            <div className="container">
                <h4 className="center">Ethiopia</h4>
                <button className="button" onClick={this.clickHandler}>Register Me</button>
                <p>The discount code's location is returned in the location header, not in the DiscountCode object itself. Depending on your HTTP client, the location of the discount code might follow the location header automatically.</p>
                <div>

                </div>

                <div className="gallery">
                <a target="_blank" href="cool_pic.jpg">
                <img src={cool_pic} alt="ethiopia" width="600" height="400" />
                </a>
                <div className="desc">Add a description of the image here</div>
                </div>
                <div className="gallery">
                <a target="_blank" href="semen.jpg">
                <img src={cool_pic} alt="ethiopia" width="600" height="400" />
                </a>
                <div className="desc">Add a description of the image here</div>
                </div>
                <div className="gallery">
                <a target="_blank" href="land.jpg">
                <img src={cool_pic} alt="ethiopia" width="600" height="400" />
                </a>
                <div className="desc">Add a description of the image here</div>
                </div>


            </div>
        );
    }

    }

export default Ethiopia;
